import React, { Component } from 'react';
import './App.css';

class Card extends Component {
    render() {
        // console.log(this.props.q)
        return(
            <div>
            {this.props.q.map(question => {
                return (
                <React.Fragment class="card">
                <div key={question.text}>{question.text}</div>
                <button>True</button>
                <button>False</button>
                </React.Fragment>
            )})}
            </div>
        )
    }
}

export default Card;
